import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

class Map extends React.Component {
    render(){
        return (
            <div>
                <h1>Testing</h1>
            </div>
        )
    }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Map />);
